  VALUES (35, 'MUS', 'MUS 201', 'Second Year Music Theory', 
   'MUS 101', 'Continuation of MUS 101. Chromatic harmony, modulations and related modern concepts. Prereq: MUS 101 or instructor permission.', 
   15);
