CREATE FUNCTION CH16_Archive_2017_Tournaments_1() RETURNS void AS $$
SELECT     TourneyID, TourneyDate, TourneyLocation
FROM         Tournaments
WHERE     (TourneyDate BETWEEN CAST('2017-01-01' AS Date)  AND CAST('2017-12-31' AS Date) );
