   CE.CustomerFullAddress,
   MAX(CE.StartDate) AS LatestDate,
   SUM(CE.ContractPrice) AS TotalContractPrice
FROM
    (SELECT Customers.CustLastName || ', ' || Customers.CustFirstName AS CustomerFullName,
      Customers.CustStreetAddress || ', ' || 
