(SELECT Recipe_Ingredients.RecipeID 
FROM Recipe_Ingredients
INNER JOIN Ingredients 
ON Recipe_Ingredients.IngredientID = Ingredients.IngredientID 
WHERE Ingredients.IngredientName = 'Onion') 
AND Recipes.RecipeID IN 
(SELECT Recipe_Ingredients.RecipeID 
